    console.log('data',data)
    console.log('list',list)
    const styles = {
        display: 'inline-block',
        width: '50%',
        height: '100px',
        border: '1px solid red'
    }
    const imageArea = {
        display: 'block',
        width: '100px',
        height: '100px',
        backgroundSize: '100px'
    }
    const fontStyle = {
        fontSize: 20,
    }


    return(
        <div style={styles}>
            <span style={{imageArea}}></span>
            <span>{list.brandName}</span>
            <span>{list.content}</span>
            <span>{list.majorCategoryName}</span>
        </div>  
    );
}

export default Card;
